import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the shopping cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the modal to appear
    await page.waitForSelector('.modal-content', { timeout: 5000 });

    // Take a screenshot of the cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal.png'));

    // Extract data from the cart modal
    const cartItems = await page.$$eval('.cart-item', items => items.map(item => ({
      title: item.querySelector('.cart-item-title').innerText,
      price: item.querySelector('.cart-item-price').innerText,
      quantity: item.querySelector('.quantity').innerText
    })));

    return {
      success: true,
      action: "Opened shopping cart modal and extracted cart items",
      extractedData: { cartItems },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
